import React from "react"

import MainContentStartseite from "./startseite_components/MainContentStartseite"
import Footer from "./global_components/Footer"

function Startseite(){
    return(
        <div className="container_main banner_startseite">
            <MainContentStartseite />
            <Footer />
        </div>
    )
}

export default Startseite
